var tipuesearch = {"pages": [{'title': '關於', 'text': '本學期的電腦輔助設計實習，要求每一位學員根據本硬件模板的格式建立個人的作業與網頁。 \n \n 你的學號 \n 網站電子： https://github.com/40923231/cad2021_hw \n 網站鏈接： https://40923231.github.io/cad2021_hw \n 其他與作者或作業相關資料說明或介紹 \n', 'tags': '', 'url': '關於.html'}, {'title': 'Task', 'text': '', 'tags': '', 'url': 'Task.html'}, {'title': 'Hwpages', 'text': '\n \n \n cad2b w2 \n \n \n \n 40723126 \n 40723126 \n \n \n 40723135 \n 40723135 \n \n \n 40723217 \n 40723217 \n \n \n 40732331 \n 40732331 \n \n \n 40823114 \n 40823114 \n \n \n 40823115 \n 40823115 \n \n \n 40823117 \n 40823117 \n \n \n 40823119 \n 40823119 \n \n \n 40823122 \n 40823122 \n \n \n 40823127 \n 40823127 \n \n \n 40823146 \n 40823146 \n \n \n 40823148 \n 40823148 \n \n \n 40823215 \n 40823215 \n \n \n 40871106 \n 40871106 \n \n \n 40923201 \n 40923201 \n \n \n 40923203 \n 40923203 \n \n \n 40923204 \n 40923204 \n \n \n 40923205 \n 40923205 \n \n \n 40923206 \n 40923206 \n \n \n 40923207 \n 40923207 \n \n \n 40923208 \n 40923208 \n \n \n 40923209 \n 40923209 \n \n \n 40923210 \n 40923210 \n \n \n 40923211 \n 40923211 \n \n \n 40923212 \n 40923212 \n \n \n 40923213 \n 40923213 \n \n \n 40923214 \n 40923214 \n \n \n 40923216 \n 40923216 \n \n \n 40923217 \n 40923217 \n \n \n 40923218 \n 40923218 \n \n \n 40923219 \n 40923219 \n \n \n 40923220 \n 40923220 \n \n \n 40923221 \n 40923221 \n \n \n 40923223 \n 40923223 \n \n \n 40923224 \n 40923224 \n \n \n 40923225 \n 40923225 \n \n \n 40923226 \n 40923226 \n \n \n 40923227 \n 40923227 \n \n \n 40923228 \n 40923228 \n \n \n 40923229 \n 40923229 \n \n \n 40923230 \n 40923230 \n \n \n 40923231 \n 40923231 \n \n \n 40923232 \n 40923232 \n \n \n 40923233 \n 40923233 \n \n \n 40923234 \n 40923234 \n \n \n 40923235 \n 40923235 \n \n \n 40923236 \n 40923236 \n \n \n 40923237 \n 40923237 \n \n \n 40923238 \n 40923238 \n \n \n 40923239 \n 40923239 \n \n \n 40923240 \n 40923240 \n \n \n 40923241 \n 40923241 \n \n \n 40923242 \n 40923242 \n \n \n 40923243 \n 40923243 \n \n \n 40923244 \n 40923244 \n \n \n 40923245 \n 40923245 \n \n \n 40923246 \n 40923246 \n \n \n 40923247 \n 40923247 \n \n \n 40923248 \n 40923248 \n \n \n 40923249 \n 40923249 \n \n \n 40923250 \n 40923250 \n \n \n 40923251 \n 40923251 \n \n \n 40923252 \n 40923252 \n \n \n 40923253 \n 40923253 \n \n \n 40971220 \n 40971220 \n \n \n 40971227 \n 40971227 \n \n \n \n \n', 'tags': '', 'url': 'Hwpages.html'}, {'title': 'HW1', 'text': 'HW1 佔學期績效 25% \n HW1必須在2021.11.10 22:00之前完成。 \n HW1具體項目成果回報區 將於2021.09.23開啟，於 2021.11.10 22:00關閉。 \n 作業一：meArm機器人零件繪圖與機電運動模擬場景製作 \n Step1 ：下載 meARM.7z 這個包含未完成組立的meArm Robot場景與雷射切割粒子組立手冊。 \n meArm_75-0040_v1.pdf 則是另外一本組立參考手冊。 \n Step2 ：從課程網頁中的 Compile CoppeliaSim頁面 ，下載 coppeliaSim 4.1.0官方版與MSYS2編譯版.7z （檔案大小412 MB，解開壓縮後1GB）可攜套件。 \n Step3 ：在HW1中，要求每一位展開程序亂數分配（兩班實際亂數分配結果以上的課程）所使用的兩套參數式CAD套件，從軟體發展緣開始進行介紹、經過教育版軟體套件檔案的取得、下載安裝以及配置使用。 可知Step1中的零件尺寸，逐一完成我的手臂機器人各零件繪製與組立。 鋸縫 匯入 CoppeliaSim 進行整體配置後，以 UI介面 中的滑塊控制meArm Robot各軸的旋轉作動。 \n 2b CAD套件分配結果： https  ://mde.tw/cad2021/downloads/online/2b_hw1_cad.txt \n 附件： \n 1. CAD套件分配表： \n sw：Solidworks，inv：Inventor，nx：NX12，ons：Onshape，slvs：Solvespace \n 2a 套裝亂數分配結果 \n 2b 套裝亂數分配結果 \n 2.在兩套CAD完成零件繪圖並轉入CoppeliaSim後，為了建立動態模型必須利用 形狀編輯模式 轉為 乾淨模型 ，並與實際轉入的STL格式零件外形結合應用後建立模擬場景 （場景）。 \n 3. meARM Robot  動態模擬場景 的建構, 可參考  0 ,  1 ,  2 ,  3 ,  4 ,  5 ,  6 ,  7 , 也可參考  Uarm Robot model  與相關 影片 . \n 4. CoppeliaSim design dynamic simulations  說明頁面 . \n 5.  網際 Lua  程式執行. \n 6.  meArm.slvs ,  meArm_in_solvespace.slvs \n 7. UI 介面程式參考: \n function closeEventHandler(h) \n    sim.addLog(sim.verbosity_scriptinfos,\'Window \'..h..\' is closing...\') \n    simUI.hide(h) \nend \n \nfunction joint1_rotate(ui,id,newVal) \n    simUI.setLabelText(ui,3000,\'theta1 set to \'..newVal) \n    sim.setJointTargetPosition(joint1, newVal*deg) \nend \n \nfunction joint2_rotate(ui,id,newVal) \n    simUI.setLabelText(ui,3000,\'theta2 set to \'..newVal) \n    sim.setJointTargetPosition(joint2, newVal*deg) \nend \n \nfunction joint3_rotate(ui,id,newVal) \n    simUI.setLabelText(ui,3000,\'theta3 set to \'..newVal) \n    sim.setJointTargetPosition(joint3, newVal*deg) \nend \n \nfunction joint16_rotate(ui,id,newVal) \n    simUI.setLabelText(ui,3000,\'theta16 set to \'..newVal) \n    sim.setJointTargetPosition(joint16, newVal*deg) \n    sim.setJointTargetPosition(joint20, -newVal*deg) \nend \n \nfunction sysCall_init() \n    -- do some initialization here \n    joint1 = sim.getObjectHandle(\'motor1\') \n    joint2 = sim.getObjectHandle(\'motor2\') \n    joint3 = sim.getObjectHandle(\'motor3\') \n    joint16 = sim.getObjectHandle(\'motor16\') \n    joint20 = sim.getObjectHandle(\'motor20\') \n    i = 0 \n    deg = math.pi/180 \n    print(i) \n    xml = [[ \n<ui closeable="true" on-close="closeEventHandler" resizable="true"> \n    <label text="This is a demo of the CustomUI plugin. Browse through the tabs below to explore all the widgets that can be created with the plugin." wordwrap="true" /> \n    <tabs> \n        <tab title="Numeric">a \n            <label text="Sliders can be oriented horizontally or vertically, and have optional properties that can be set (in the XML) such as minimum and maximum value." wordwrap="true" /> \n            <label text="" id="3000" wordwrap="true" /> \n            <label text="theta1" /> <hslider tick-position="above" tick-interval="1"  \n            minimum="0" maximum="360" on-change="joint1_rotate" /> \n            <label text="theta2" /> <hslider tick-position="above" tick-interval="1"  \n            minimum="-90" maximum="65" on-change="joint2_rotate" /> \n            <label text="theta3" /> <hslider tick-position="above" tick-interval="1"  \n            minimum="-90" maximum="185" on-change="joint3_rotate" /> \n            <label text="theta16" /> <hslider tick-position="above" tick-interval="1"  \n            minimum="0" maximum="15" on-change="joint16_rotate" /> \n        </tab> \n    </tabs> \n</ui> \n]] \n    ui=simUI.create(xml) \n     \nend \n \n (From:  2016_ADDITIVE MANUFACTURING PROCESSES FOR FABRICATING A MINI ROBOT - COMPUTATIONAL MODELS AND EXPERIMENTAL RESULTS.pdf ) \n \n', 'tags': '', 'url': 'HW1.html'}, {'title': 'W13', 'text': '\n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'W13.html'}, {'title': 'Solidworks\xa0繪圖', 'text': '緣起說明與介紹: \n SolidWorks公司成立於1993年12月，其總部設在美國麻州康克爾郡，西元1995年發表其第一款產品SolidWorks 95，1997年被達梭系統併購，SolidWorks公司現在是達梭系統的子公司。 \n \n', 'tags': '', 'url': 'Solidworks\xa0繪圖.html'}, {'title': 'Solidworks\xa0安裝配置', 'text': '\n 由於安裝配置 Solidworks 時必須使用 nfu 的 vpn, 因此各學員必須按照 說明 , 完成本學期的 vpn 使用申請. \n Solidworks 分別提供 2017 與 2020 版本: \n SW2017 Professional 安裝光碟下載  (必須先登入 @gm 帳號後才能下載) \n SW2020 Professional 安裝光碟下載  (必須先登入 @gm 帳號後才能下載) \n \n \n', 'tags': '', 'url': 'Solidworks\xa0安裝配置.html'}, {'title': 'Solidworks\xa0操作流程', 'text': 'Solidworks\xa0零組件繪圖操作流程影片 \xa0https://youtu.be/l_hqiHA6KUM \n Solidworks  零組件繪圖教學影片 (Wink) \n \n', 'tags': '', 'url': 'Solidworks\xa0操作流程.html'}, {'title': 'NX12\xa0繪圖', 'text': '緣起說明與介紹 : \n NX，原名“unigraphics”，是一款先進的高端CAD\xa0/\xa0CAM\xa0/\xa0CAE，自2007年起由Siemens PLM Software擁有。\xa02000 年，Unigraphics 購買了SDRC I-DEAS並開始努力將兩個軟件包的各個方面集成到一個產品中，該產品成為Unigraphics NX或NX。 \n 歷史: \n 1972 年:\xa0United Computing, Inc. 發布 UNIAPT，這是世界上第一個終端用戶 CAM 產品之一。 \n 1973 年: 該公司於 1973 年從MCS購買了自動繪圖和加工 (ADAM) 軟件代碼。該代碼成為名為 UNI-GRAPHICS 的產品的基礎，後來在 1975 年作為 Unigraphics 進行商業銷售。 \n 1976 年:\xa0McDonnell Douglas Corporation收購了 United Computing。 \n 1983 年:\xa0UniSolids V1.0 發布，標誌著業界第一個真正的交互式實體建模軟件產品。 \n 1991 年: 在財政困難時期，麥克唐納道格拉斯自動化公司(McAuto) 將其商業服務機構（包括Unigraphics 機構和產品）出售給當時歸GM所有的EDS。Unigraphics 成為 GM 的企業CAD 系統。 \n 1992 年: Unigraphics 超過 21,000 個席位在全球範圍內使用。 \n 1996 年: Unigraphics V11.0 發布，增強了工業設計和建模功能，包括橋面、曲線和曲面的曲率分析、面融合、可變偏移曲面等。在裝配建模領域，新功能包括組件過濾器、多面表示，以及多個組件之間的間隙分析。還包括一個與基於特徵的建模鏈接的完全集成的電子表格。 \n 2002 : 首次發布 Unigraphics 和I-DEAS的新“下一代”版本，稱為 NX，開始過渡，將 Unigraphics 和I-DEAS 的功能和能力整合到一個單一的整合產品中。 \n 2007:\xa0年 NX 5 中同步技術的介紹。 \n 2011:\xa0年 10 月 17-2011年發布 NX8 \n 2013:\xa0年 10 月 14-2013年發布 NX9（僅限 x64） \n 主要功能: \n \n 計算機輔助設計（CAD）（設計） \n \n 參數化實體建模（基於特徵和直接建模） \n 自由曲面建模，A類曲面。 \n 逆向工程 \n 造型和計算機輔助工業設計 \n 產品和製造信息(PMI) \n 報告和分析，驗證和確認 \n 知識重用，包括基於知識的工程 \n 鈑金設計 \n 裝配建模和數字模型 \n 路由用於電器佈線和機械管道 \n \n \n 計算機輔助工程 （CAE）（模擬） \n \n 應力分析/有限元法（FEM） \n 運動學 \n 計算流體力學(CFD) 和熱分析 \n \n \n 計算機輔助製造 (CAM) (Manufacturing) \n \n 數控(NC) 編程 \n \n \n \n', 'tags': '', 'url': 'NX12\xa0繪圖.html'}, {'title': 'NX12\xa0安裝配置', 'text': 'NX12 版本: \n NX12 安裝光碟下載  (必須先登入 @gm 帳號後才能下載) \n NX12 可攜版本下載 \xa0(必須先登入 @gm 帳號後才能下載) \n 影片: NFU-MDE-acd2021-40923231-NX12下載安裝與配置', 'tags': '', 'url': 'NX12\xa0安裝配置.html'}, {'title': 'NX12\xa0操作流程', 'text': 'NX12 零組件繪圖操作流程影片  https://youtu.be/-3kUiqg6MXA \n NX12 零組件繪圖教學影片 (Wink) \n \n', 'tags': '', 'url': 'NX12\xa0操作流程.html'}, {'title': '運動場景', 'text': 'CAD1: \n CAD1 零件轉出後轉入 CoppeliaSim 操作影片 (Youtube) \n CAD1 零件轉入 CoppeliaSim 教學影片 (Wink) \n CAD1 轉入 Coppeliasim 教學影片 embedded 影片: 標題必須為「 NFU - MDE - cad2021 - 學號 - SW2020  零件轉入 CoppeliaSim 教學影片」且加上 語音說明 與 字幕. \n CAD2: \n CAD2 零件轉出後轉入 CoppeliaSim 操作影片 (Youtube) \n CAD2 零件轉入 CoppeliaSim 教學影片 (Wink) \n CAD2 轉入 Coppeliasim 教學影片 embedded 影片: 標題必須為「 NFU - MDE - cad2021 - 學號 - SW2020  零件轉入 CoppeliaSim 教學影片」且加上 語音說明 與 字幕. \n 若使用 Solidworks 2017 版, 則將 SW2020 換為 SW2017, 其他套件 INV2020 代表 AutoDesk Inventor 2020 版, 還有 Onshape 與 Solvespace 等套件名稱. \n', 'tags': '', 'url': '運動場景.html'}, {'title': 'HW1-1', 'text': 'HW1-1 佔學期成績 15% \n HW1-1 必須在 2021.12.01 22:00 之前完成. \n HW1-1 具體項目成果回報區 將於 2021.11.18 開啟, 於  2021.12.01 22:00 關閉. \n 作業 1-1: Mirobot 機械手臂場景組合 \n 說明: meArm Robot 有四個自由度, 請根據 HW1 的零組件繪製組立與 CoppeliaSim 運動場景模擬, 延伸至  Task1-1  中六個自由度的 Mirobot 機械手臂. \n mirobot_part1_to_part5.7z  為取自 \xa0 https://github.com/wlkata/Mirobot-STL  的參考零件. 請利用場景中 Mirobot STL 零件, 組合為可以透過  UI 介面 中的 slider 控制各軸作動旋轉的運動模型. \n 請根據  Task1-1  中的說明, 完成各項指定任務. \n', 'tags': '', 'url': 'HW1-1.html'}, {'title': 'HW2', 'text': 'HW2 佔學期成績 20% \n HW2 必須在 2021.12.22 22:00 之前完成. \n HW2 具體項目成果回報區 將於 2021.12.09 開啟, 於  2021.12.22 22:00 關閉. \n meArm 逆向運動學與網際參數式 CAD API 結合應用. \n 請將  https://github.com/mdecourse/meArm  中的 meArm Robot 逆向運動學程式, 改為 Lua 與 Python 程式, 使能套用至 HW1 所完成的 CoppeliaSim meArm 運動模擬場景. 並分別採 Lua, Legacy remote API 及 Bluezero remote API 逆向運動的方式進行控制. \n 請利用  Task2  中的 Solidworks, Inventor 與 NX API 程式控制 meArm Robot 零組件尺寸, 說明並討論如何透過網際程式控制 meArm Robot 的零件尺寸, 並結合上述逆向運動學程式庫, 使得自動化機電產品開發流程更容易滿足客製化需求. \n 參考: \n 2016_ADDITIVE MANUFACTURING PROCESSES FOR FABRICATING A MINI ROBOT - COMPUTATIONAL MODELS AND EXPERIMENTAL RESULTS.pdf \n Robot Manipulator Control with Inverse Kinematics PD-Pseudoinverse Jacobian and Forward Kinematics Denavit Hartenber.pdf \n KINEMATIC ANALYSIS FOR ROBOT ARM.pdf \n https://codebender.cc/user/MeArm \n https://github.com/mdecourse/meArmPi \n /downloads/MeArmPiTechnicalOverviewV0-3DRAFT.pdf \n https://github.com/mdecourse/me-arm-ik \n https://github.com/mdecourse/mearm_model \n https://courses.ece.cornell.edu/ece5990/ECE5725_Fall2016_Projects/pas324_ml634/index.html \n https://github.com/mdecourse/InefficientSkittleSorter \n https://mearm.com \n', 'tags': '', 'url': 'HW2.html'}, {'title': 'HW3', 'text': 'HW3 為選項作業. \n HW3 具體項目成果回報區 將於 2021.12.09 開啟, 於  2022.01.05 22:00 關閉 \n https://mde.tw/cad2021/content/Task3.html \xa0 \n https://mde.tw/cad2021/content/Task4.html \n https://mde.tw/cad2021/content/Task5.html \n https://mde.tw/cad2021/content/Task6.html \n https://mde.tw/cad2021/content/Task7.html \n 請從上列 Tasks 中自行選擇項目內容完成 HW3. \n', 'tags': '', 'url': 'HW3.html'}, {'title': 'Final Project', 'text': 'Final Project 佔學期成績 40% \n 2a 與 2b 必須在 2022.01.06 上課之前完成 Final Project \n \n 零件 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n \n \n ----------------------------------------- \n 多連桿 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n ----------------------------------------- \n 延伸題 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n ---------------------------------- \n 心得: \n', 'tags': '', 'url': 'Final Project.html'}, {'title': '期末考試', 'text': '第一階段(零件+組合圖) \n \n \n \n \n   \n \n \n \n \n \n \n \n \n --------------------------------------------------- \n 第二階段 \n \n \n \n \n   \n \n \n \n \n \n \n \n \n --------------------------------------------------- \n 第三階段(CoppeliaSim) \n \n \n \n \n   \n \n \n \n \n \n \n \n \n --------------------------------------------------- \n 心得:', 'tags': '', 'url': '期末考試.html'}]};